import React, { Component } from "react";




export default class form extends Component {
    constructor(props) {
        super(props);
    }

    changeHandler = event => {
        this.setState({
            email: event.target.value
        });
    }

    render() {
        return (
            <form>
                <input type="email"
                    name="email"
                    value={this.state.email}
                    onChange={this.changeHandler}
                />
            </form>
        );
    }
}
